    return (
            show && (
                <div className="h-full rounded-md border-solid border-1 bg-zinc-300 h-auto  m-1 p-12">
                    <div className="text-2xl grid place-items-center mb-8">{title}</div>
                    <p>{content}</p>
                    <div className="inline-flex m-2 align-middle">{children}</div>
                </div>
            )
    )
}

export default Container;
